import React from 'react'
import uploadImage from "../../assets/Images/Upload-video-preview.jpg"

function Upload() {
    return (
        <div>
            <h1>Upload Video</h1>
            <h2>VIDEO THUMBNAIL</h2>
            <img src= {uploadImage}/>
        </div>
    )
}

export default Upload
